import React from "react";
import {Button, Container, Navbar,Row,Col} from 'react-bootstrap';
import './App.css';
import { Alert,Accordion } from "react-bootstrap";

const  App = () => {
  return (
    <div>
      <Navbar bg="success" expand='sm' variant='light'>
        <Container>
            <Row>
              <Col xs={4}>
                <Navbar.Brand href='/'>Home</Navbar.Brand>
              </Col>
              <Col xs={4}>
                <Navbar.Brand href='/'>STORE</Navbar.Brand>
              </Col>
              <Col xs={4}>
                <Navbar.Brand href='/'>ABOUT</Navbar.Brand>
              </Col>
            </Row>

        </Container>
      </Navbar>

    </div>
  );
}

export default App;
